import React, { useState } from "react";
import { BrowserRouter as Router, Switch, Redirect, Route } from "react-router-dom";
import App from "../App"

const Routes = () => {
    return(
        <Router>
            <Switch>
                <Route path="/Main" component={App} />
            </Switch>
        </Router>
    )
}

export default Routes;
